        <div>
            <Header />
            <div className="container">
                <div className="row ">
                    <div className="col-6 text-center">
                        <TopArticle />          
                    </div>
                    <div className="col-6">
                        <ListArticle />
                    </div>
                </div>
            </div>
        </div>
      );
    }
}

export default Home;
